import React, { useEffect } from 'react';
import { connect } from 'react-redux';
import { searchMovies, searchTvShows } from '../actions';
import MovieRow from '../components/movies/MovieRow';
import TvRow from '../components/tvs/TvRow';
import styles from './Search.module.css';

const Search = (props) => {
  // Should call action creator somewhere upper level than here?
  useEffect(() => {
    props.searchMovies();
    props.searchTvShows();
  }, []);

  return (
    <div className={styles.search}>
      <h3 className={styles.title}>Search "friends"</h3>
      <MovieRow category="Movies" type="search" />
      <TvRow category="TV Shows" type="search" />
    </div>
  );
};

export default connect(null, {
  searchMovies: searchMovies,
  searchTvShows: searchTvShows,
})(Search);
